import React from 'react';

let tasks = ["1", "2", "3"];

class App extends React.Component {
    render() {
        return (
            <div className="task-list">
                {tasks.map(task => (
                    <div className="task">
                        <input type="checkbox" /> 
                        <p>Task {task}</p>
                    </div>
                ))}
            </div>
        )
    }
}

export default App;
